import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './LearningMaterials.css'; // Make sure to include the CSS file

const LearningMaterials = () => {
  const [files, setFiles] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredFiles, setFilteredFiles] = useState([]);
  const [message, setMessage] = useState('');

  const baseURL = process.env.REACT_APP_API_URL || 'http://localhost:5000';

  useEffect(() => {
    const fetchFiles = async () => {
      try {
        const response = await axios.get(`${baseURL}/api/files`);
        setFiles(response.data);
        setFilteredFiles(response.data);
      } catch (error) {
        console.error('Error fetching files:', error);
        setMessage('Error fetching files.');
      }
    };

    fetchFiles();
  }, [baseURL]);

  const handleSearchChange = (e) => {
    const query = e.target.value.toLowerCase();
    setSearchQuery(query);
    const filtered = files.filter(file =>
      file.originalname.toLowerCase().includes(query)
    );
    setFilteredFiles(filtered);
  };

  const getFileIcon = (filename) => {
    const ext = filename.split('.').pop().toLowerCase();
    switch (ext) {
      case 'pdf': return '📄';
      case 'doc':
      case 'docx': return '📝';
      case 'ppt':
      case 'pptx': return '📊';
      case 'xls':
      case 'xlsx': return '📈';
      case 'jpg':
      case 'jpeg':
      case 'png': return '🖼️';
      case 'mp4':
      case 'mkv': return '🎞️';
      case 'zip':
      case 'rar': return '🗜️';
      case 'txt': return '📃';
      default: return '📁';
    }
  };

  const handleDelete = async (filename) => {
    const confirmDelete = window.confirm(`Are you sure you want to delete "${filename}"?`);
    if (!confirmDelete) return;

    try {
      await axios.delete(`${baseURL}/api/files/${filename}`);
      const updatedFiles = files.filter(file => file.filename !== filename);
      setFiles(updatedFiles);
      setFilteredFiles(updatedFiles);
      setMessage(`File "${filename}" deleted successfully.`);
    } catch (error) {
      console.error('Error deleting file:', error);
      setMessage('Failed to delete file.');
    }
  };

  return (
    <div className="learning-materials-container">
      <h2 className="learning-materials-title">Learning Materials</h2>
      
      <div className="search-bar-container">
        <input
          type="text"
          className="search-bar"
          placeholder="Search for files..."
          value={searchQuery}
          onChange={handleSearchChange}
        />
      </div>

      <div className="file-grid">
        {filteredFiles.length === 0 ? (
          <p className="no-files-message">No files found.</p>
        ) : (
          filteredFiles.map((file) => (
            <div className="file-card" key={file.filename}>
              <div className="file-info">
                <span className="file-icon">{getFileIcon(file.originalname)}</span>
                <div>
                  <p className="file-name">{file.originalname}</p>
                  <p className="file-size">{(file.size / 1024 / 1024).toFixed(2)} MB</p>
                </div>
              </div>
              <div className="file-actions">
                <a
                  href={`${baseURL}${file.url}`}
                  className="view-btn"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  View
                </a>
                <a
                  href={`${baseURL}${file.url}`}
                  className="download-btn"
                  download
                >
                  Download
                </a>
                <button
                  className="delete-btn"
                  onClick={() => handleDelete(file.filename)}
                >
                  Delete
                </button>
              </div>
            </div>
          ))
        )}
      </div>

      {message && <p className="message">{message}</p>}
    </div>
  );
};

export default LearningMaterials;
